import React from "react";
import NavBar from "../Components/NavBar";
import home_image from "../Resources/home_image.jpg";

const Home = () => {
  return (
    <div className="bg-blue-500 w-screen h-screen">
      <div className="w-screen">
        <NavBar />
      </div>

      <div>
        <div className="bg-green-800 w-screen h-[500px]">
          <img src={home_image} alt="" className="w-screen h-[700px]" />
        </div>
        <div className="absolute inset-0 flex flex-col items-center justify-center text-center text-white">
          <h2 className="text-2xl font-bold">
            University Of Sri Jayewardenepra
          </h2>
          <h1 className="text-8xl font-bold">Medical Center</h1>
        </div>
      </div>

      <div className="bg-orange-500 w-screen h-48"></div>
      <div className="bg-orange-800 w-screen h-[360px]"></div>
    </div>
  );
};

export default Home;
